import React from 'react';

const List =(props)=>{
    return(<li>{props.value}</li>)
}
//functional Component
function Header(props){
    return(
      <div>
        <h1>Header</h1>
        <ul>
          <List value="home"/>
          <List value="About"/>
        </ul>
      </div>
    )
  }

  export default Header;
